		createjs.Sound.registerSound("./sounds/gamebackgroundmusicloopshortmp3.mp3", "backgroundmusic");
		
		var notPlaying = 0; //משתנה לבדיקה כמה זמן לא משחקים
		var mychoice = 0; //משתנה לבדיקה איזה משחק נבחר
