		var speed = 3;
		var timeInterval;
		var counter = 0; // משתנה שנועד לתת שמות ייחודיים לקלפים שנופלים לשם זיהוי מאוחר יותר
		
		var minutes = 0; //  דקות 
		var seconds = 0; //  שניות
		
		var countTrue = 0; // מחזיק את כמות הקלפים התואמים לקטגוריה בכל משחק לשם סיום באסיפת כולם
		
		//totalAns
		var countTotalTrue = 0; //שומר את סך הפריטים הנכונים הכולל בשביל חישוב הניקוד ומד ההתקדמות (הקלפים בקופסא)
		var countTotalFalse = 0; // שומר את סך הפריטים השגויים הכולל בשביל חישוב הניקוד
		var totalAns = 0; //שומר את סך הפריטים הכולל של המשחק גם נכון וגם לא נכון
		//totalAns
		
		//totalMistakes
		var countMissedTrue = 0; // שומר פריטים נכונים שפספסת missed true
		var countCatchFalse = 0; // שומר פריטים לא נכונים שאספת catch false
		var totalMistakes = 0;
		var totalScore = 0;
		var forcombo;
		var openScreen;
		var allowSound = true;
		var currentKeyPressed = 0;
		var firstTrueCard;
		var speedsArr = [3, 6, 9]
		var speedIndex = 0;
		// משתנים גלובלים
		
		
		// מערכים שמחזיקים טקסטים לחיוויים לפספוס אותפיסה של מסיח תואם לקטגוריה / לא תואם לקטגוריה
		var positiveFeedbackArray = [
			"תפיסה מצויינת",
			"כל הכבוד",
			"נכון מאוד"
		]
		var missedPositiveFeedbackArray = [
			"מזל שלא תפסת",
			"נכון, זה לא מתאים",
			"מזל, זה לא שייך"
		]
		
		
		var negativeFeedbackArray = [
			"זה לא מתאים לחבילה",
			"קרוב, אבל לא",
			"זו טעות"
		]
		
		var missedTrueFeedbackArray = [
			"חבל, פספסת",
			"זה התאים לחבילה",
			"?איך פספסת"
		]
		
		var myGame = [];
		var GameName = "";
		var gameInstruction = "";
		function fillArray() {
		
			var encodeGameName = (myJSON.game.GameName).replace(/\+/g, '%20'); // מקדד
			GameName = decodeURIComponent(encodeGameName); // מקודד
		
			var encodeGameInstruction = (myJSON.game.GameInstructions).replace(/\+/g, '%20'); // מקדד
			gameInstruction = decodeURIComponent(encodeGameInstruction);
			var itemCount = myJSON.game.items.item.length; //כמות המסיחים
		
		
			for (i = 0; i < itemCount; i++) {
		
				var item = (myJSON.game.items.item[i]["#text"]).replace(/\+/g, '%20');
				var itemContent = decodeURIComponent(item);
		
				var ansType = (myJSON.game.items.item[i]["@AnsType"]);
				var feedback = (myJSON.game.items.item[i]["@feedback"]);
		
		
				if (feedback == "true") {
		
					feedback = true;
				} else {
		
					feedback = false;
				}
		
				if (ansType == "text") {
		
					ansType = "text";
				} else {
		
					ansType = "pic";
				}
		
				myGame.push([item, ansType, feedback, 0])
			}
		}
		
