		function initProgressBar() {
			var gameScreen = stage.getChildByName("gameScreen")
			var amount = [10, 20, 30]
			var displayProgressBar = [lib.progressBar10, lib.progressBar20, lib.progressBar30]
			var size = 0;
		
			for (i = 0; i < amount.length; i++) {
				if (countTotalTrue > amount[i]) {
					size++
				}
			}
		
			progressSize = lib.trueCardL
			createProgressBar(displayProgressBar[size])
			var redundentCards = amount[size] - countTotalTrue;
			var progressBar = gameScreen.getChildByName("progressBar")
			if (redundentCards > 0) {
				for (i = 0; i < redundentCards; i++) {
					var cardToRemove = "a" + (amount[size] - i).toString();
					progressBar[cardToRemove].alpha = 0;
		
				}
			}
		
		}
		
		
