		function trueAndFalseAnswer(array) { // בודק כמה תשובות נכונות יש במשחק 
			var index;
			for (i = 0; i < array.length; i++) {
				if (array[i][2] == true) {
					countTrue++ // ברגע שיכנס קלף נכון למסך תרד כמות המשתנה (בהמשך - ברגע שיגיע לאפס יסתיים המשחק)
					countTotalTrue++
					if (countTrue == 1) {
						// שומר למשתנה קלף אחד נכון כך שרק כאשר השחקן ראה את כל הקלפים במשחק ירד קלף 
						// אחרון שהוא בטוח נכון וכך וידאנו שכאשר השחקן ראה את כל הקלפים נגמר המשחק אבל גם כך וידאנו
						// שתמיד המשחק יסתיים עם קלף אחרון נכון
						index = i;
					}
				}
				if (array[i][2] == false) {
					countTotalFalse++
				}
			}
		
			firstTrueCard = array.splice(index, 1)[0] // מוציאים מהמערך ושומרים אותו למשתנה שיחזור כשנגמרו כל הקלפים
		
			totalAns = countTotalFalse + countTotalTrue;
		}
		
		function createCard(number) { //יוצרים את הקלף 
			var gameScreen = stage.getChildByName("gameScreen")
		
			var randomXNumber = Math.floor(Math.random() * ((stageW - 320) - 70 + 1)) + 70 // הקלף ירד בצורה רנדומלית על ציר האיקס
			var baseCard = new lib.card()
			addCardContent(number, baseCard)
			baseCard.x = randomXNumber
			gameScreen.addChild(baseCard)
			baseCard.name = "card" + counter; // יוצר שם ייחודי לקלף שיורד עכשיו
		
			fallingCardsArray.push(shuffledCardsArray[number]) // מוסיף את הקלף הנופל למערך הקלפים הנופלים
			shuffledCardsArray.splice(0, 1) // מוציאים את הקלף שנפל מהמערך הישן
			if (shuffledCardsArray.length == 0) { // במקרה שנגמר מערך הקלפים הראשי בודק אם קיים קלף נכון ששמרנו מראש ומוסיף אותו לבמה
				if (firstTrueCard != null) {
					shuffledCardsArray.push(firstTrueCard)
					firstTrueCard = null
				}
			}
			counter++
		}
		
		function addCardContent(number, baseCard) { // בדיקה אם הקלף שנפל הוא טקסט או תמונה והוספת התוכן בהתאם
			if (shuffledCardsArray[number][1] == "text") {
				baseCard.cradInnerAnimation.cardTxt.lineWidth = 85;
				baseCard.cradInnerAnimation.cardTxt.text = shuffledCardsArray[number][0]
			} else {
				baseCard.cardTxt = "";
				var cardImage = new createjs.Bitmap(imageLibPath + shuffledCardsArray[number][0]);
				cardImage.x = 5;
				cardImage.y = 17; 
				baseCard.cradInnerAnimation.addChild(cardImage)
			}
		}
		
		
		function fall() { // רץ כל פעולה של הטיקר 
			if (createjs.Ticker.paused == false) {
				if (currentKeyPressed != 0) { // אם כרגע אחד המקשים נמצא במצב לחוץ שולח לפונקציה שתפעיל את הפעולה הרצויה 
					move();
				}
		
				var player = stage.getChildByName("max")
				var gameScreen = stage.getChildByName("gameScreen")
		
				if (fallingCardsArray.length == 0 && shuffledCardsArray.length != 0) {
					console.log("this happend!")
					createCard(0);
				}
		
				for (i = 1; i <= fallingCardsArray.length; i++) {
		
					var fallingCard = gameScreen.getChildByName("card" + (counter - i)); //נוסיף לו המהירות שזה באעצם המיקום שלו בציר הויי
					fallingCard.y += speed
					if (fallingCard.y > (stageH / 2) && fallingCard.y <= (stageH / 2) + speed) { // אם הקלף מגיע לאמצע הבמה תוסיף עוד קלף
						if (fallingCardsArray.length < 2 && shuffledCardsArray.length != 0) { // אם יש פחות משתי קלפים בכל רגע במסך ואם יש עוד קלפים במערך הראשי תוסיף קלף לבמה
							createCard(0);
							console.log(fallingCard.y, "fallingCard.y")
							console.log((stageH / 2), "(stageH / 2)")
							console.log(speed, "speed")
						}
					} else if (intersect(fallingCard, player)) { // בדיקה אם יש פגיעה של הקלף והשחקן
						createjs.Ticker.paused = true;
						clearInterval(timeInterval); // עוצרים את ספירת הזמן
		
						return checkQuestion(fallingCard.name, i) // שולח לפונקציה שתבדוק את תוצאת הפגיעה לפי חוקי המשחק
		
					} else if (fallingCard.y >= 600) { // בדיקה אם יש פגיעה של הקלף ברצפה
						fallingCard.gotoAndPlay(25); // מפעיל אנימציה
						createjs.Ticker.paused = true; // עוצר את הטיקר
						clearInterval(timeInterval); // עוצר את ספירת הזמן
		
						return checkQuestionNotCatch(fallingCard.name, i) // שולח לפונקציה שתבדוק את תוצאת הפגיעה לפי חוקי המשחק
					}
				}
				if (shuffledCardsArray.length == 0 && fallingCardsArray.length == 0) { // אם המערכים ריקים תסיים את המשחק
					gameScreen.removeChild(gameScreen.getChildByName(fallingCard));
					console.log('sss')
					endAnimation();
				}
		
			}
		}
		
		function move() { // אחראית על תזוזת השחקן ימינה ושמאלה
			var max = stage.getChildByName("max")
			if (currentKeyPressed == 37) {
				//left
				notPlaying = 0 // מאפסת את הזמן שהשחקן לא שיחק
				max.gotoAndStop(1); // מפעיל אנימציה פנימית
		
		
				if (max.x > 70) { // שומר על השחקן בגבולות הבמה
					//מהירות הדמות
					createjs.Tween.get(max).to({ // אחראית על תזוזה חלקה של השחקן
						x: max.x - 9,
						override: true
					}, 10);
				}
			}
			if (currentKeyPressed == 39) {
				//right
				notPlaying = 0
				max.gotoAndStop(1);
		
				if (max.x < stageW - 250) { // שומר על השחקן בגבולות הבמה
					createjs.Tween.get(max).to({ // אחראית על תזוזה חלקה של השחקן
						x: max.x + 9,
						override: true
					}, 10);
				}
			}
		}
		
		function progress(countTrue) {
			var gameScreen = stage.getChildByName("gameScreen")
			var progressBar = gameScreen.getChildByName("progressBar")
			var position = "a" + (countTotalTrue - countTrue).toString();
		
			var cardToAdd = new progressSize();
			cardToAdd.x = 0;
			cardToAdd.y = 0;
			cardToAdd.name = "cardToAdd" + countTrue.toString();
		
			setTimeout(function () {
				progressBar[position].addChild(cardToAdd)
			}, 800)
		}
		
		function checkQuestion(fallingCardName, fallingCardIndex) { // בדיקה של פגיעה של הקלף בשחקן
			createFeedback();
			var max = stage.getChildByName("max");
			var feedbackBubble = stage.getChildByName("feedbackBubble");
			var gameScreen = stage.getChildByName("gameScreen");
			var fallingCard = gameScreen.getChildByName(fallingCardName);
		
			var rigtORwrong = fallingCardsArray[0][2]; // בדיקה אם תפיסה נכונה
			if (rigtORwrong) { // במקרה של מסיח מתאים לקטגוריה
				var rndFeedback = Math.floor(Math.random() * positiveFeedbackArray.length);
				feedbackBubble.feedback_txt.text = positiveFeedbackArray[rndFeedback] //רנדום של המערך של פידבק רנדומלי
		
				max.gotoAndPlay(40); // מפעיל אנימציה פנימית
		
				if (allowSound == true) { // חיוויים לתפיסה נכונה
					createjs.Sound.play("Woo");
				}
				resultArray.push(fallingCardsArray[0]) // מכניס את הקלף למערך אחר להצגת הקלפים בסוף המשחק
				fallingCardsArray.splice(0, 1);  // חותך את הקלף מהמערך
				countTrue-- // מפחית מכמות הנכונים שיש במשחק (כאשר יגיע לאפס יגמר המשחק)ק
				createjs.Tween.get(fallingCard, {
					ignoreGlobalPause: true,
					duration: 1000
				}).to({
					x: 1120,
					y: 200,
					rotation: 360,
					scaleX: 0.7,
					scaleY: 0.7
				}, 1000).call(progress, [countTrue]);
		
			} else { // במקרה של מסיח לא תואם לקטגוריה
				var rndFeedback = Math.floor(Math.random() * negativeFeedbackArray.length);
				feedbackBubble.feedback_txt.text = negativeFeedbackArray[rndFeedback]
		
				max.gotoAndPlay(1);
		
				if (allowSound == true) { // במידה ונתפס קלף שגוי יהיו חיוויים בהתאם
					createjs.Sound.play("HoNo");
				}
				fallingCardsArray[0][3] += 1 // יתווסף אחד למקום השלישי [2] במערך בשביל הצגת שגיאות לשחקן במסך הסיום
				countCatchFalse++
				totalMistakes = countMissedTrue + countCatchFalse; // סופר כמות טעויות כללית
		
				resultArray.push(fallingCardsArray[0]) // מכניס את הקלף למערך אחר להצגת הקלפים בסוף המשחק
		
				fallingCardsArray.splice(0, 1);  // חותך את הקלף מהמערך
		
			}
		
			// מסיר את הקלף מהבמה
			setTimeout(function () { // פונקציה שקורת לאחר 2 שניות
				feedbackBubble.feedback_txt.text = ""
				stage.removeChild(stage.getChildByName("feedbackBubble")) // מסירה את בועית החיוויי
				gameScreen.removeChild(gameScreen.getChildByName(fallingCardName))
				if (countTrue == 0) { // בדיקה אם נגמרו הקלפים הנכונים, במידה וכן יגמר המשחק וישלח למסך סיום
					console.log(countTrue, "countTrue")
					endAnimation();
					//createEndGameSummaryScreen();
					gameScreen.removeChild(gameScreen.getChildByName(fallingCardName))
					return
				}
				createjs.Ticker.paused = false; // ממשיך את הטיקר
				timeInterval = setInterval(timer, 1000); // ממשיך את ספירת הזמן
				max.gotoAndPlay(0);
		
			}, 2000)
		}
		
		
